INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 0, 2, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 0, 2, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "士条 怜", "フェンシングを始めてみては？", "キミに必要な集中力と感性が", 0, 2, 0, 0, "少しは磨かれると思いますよ。", 1003, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "穂高 みそぎ", "ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 0, 2, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "風宮 あかり", "風宮あかりです", "ねぇ…", 0, 2, 0, 0, "私といっしょに…\nいかない？", 1006, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "出雲 宮子", "出雲宮子なのー", "プリンたべたいのー", 0, 2, 0, 0, "食べ物の恨みは怖いのー", 1007, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "虹村 雪", "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 2, 0, 0, "いいよ。\n見られることは運命さ…", 1008, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "柊杏奈", "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 2, 0, 0, "人呼んで「疾風の冥姫」!!", 1009, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 2, 0, 0, "ほんまおおきにやわ～♪", 1010, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "衣之咲 璃乃", "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, 2, 0, 0, "ここで会ったが\n100年目～！", 1011, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 0, 2, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1012, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 0, 2, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 0, 2, 0, 0, "でも、沖縄もとってもいいとこさー", 1017, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "支倉 伊緒", "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 0, 2, 0, 0, "イオちゃんって呼んでね。", 1018, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 0, 2, 0, 0, "ミミをおいてかないでぇ～", 1020, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 0, 2, 0, 0, "ふぇぇぇぇぇん……", 1021, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "風宮 より", "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 0, 2, 0, 0, "なんてありがとうございます！", 1022, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 0, 2, 0, 0, "私こっち行きたいー\nね、早く早くー", 1023, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, 2, 0, 0, "これて何か違う…\nあああすみません！", 1025, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 0, 2, 0, 0, "離しませんわ………\n絶対に…!!", 1027, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 2, 0, 0, "…そうでしょ？？", 1028, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "桜井 望", "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 0, 2, 0, 0, "あはは、\n私もまだまだだなぁ～", 1029, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "ニノン・ジュベール", "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, 2, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 0, 2, 0, 0, "おかしいですね……", 1031, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 0, 2, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1033, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 0, 2, 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1034, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "氷川 鏡華", "氷川鏡華…です", "知らない人とは話しちゃいけないので", 0, 2, 0, 0, "これ以上お話しすることは…\nないです！", 1036, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "柏崎 栞", "柏崎…栞です。", "……あ、アラーム。", 0, 2, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "双葉 碧", "ふ、双葉碧です。", "私、一人も友達がいなくて……", 0, 2, 0, 0, "野に咲く花が、\n唯一の話相手です。", 1040, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "三角 千歌", "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 2, 0, 0, "そう思っています。", 1042, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "安芸 真琴", "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 0, 2, 0, 0, "う、疑ってすまなかったな…", 1043, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 0, 2, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "遠見 空花", "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 0, 2, 0, 0, "ｌク、クウカに何かご用ですか!?", 1045, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 2, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "大神 美冬", "大神美冬よ！", "それでは早速クエストに…", 0, 2, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "星野静流", "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 0, 2, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "玉泉美咲", "アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で", 0, 2, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 1.5, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "リマ", "？？？", "？？？？", 0, 2, 0, 0, "？？？？", 1052, 1.4, 1, 0, 1, 0);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 0, 2, 0, 0, "そ、そこまでいうなら\nもらってやる", 1053, 1.5, 1, 0, 1, 0);
